// ReportsMenu.js
import { Link, useNavigate } from 'react-router-dom';
import './adminmenu.css';

function ReportsMenuPage() {
  const navigate = useNavigate();
  return (
    <div className="admin-menu-container">
      <h2>Reports</h2>
      <div className="admin-menu-options">
        <Link to="/hr-report" className="menu-option">HR Report</Link>
        <Link to="/admin-report" className="menu-option">Admin Report</Link>
        <Link to="/recruiter-report" className="menu-option">Recruiter Report</Link>
      </div>
      <button className="back-button" onClick={() => navigate(-1)}>Back</button>
    </div>
  );
}

export default ReportsMenuPage;
